import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Image from './images/Rectangle 2.png';

function kakao(){
    return(
        <>
            <div className="grid-container">
                <div className="box">
                    <div className="image-container"><img src={Image} alt="image"/>
                    <div className='box-text'>hello</div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default kakao;
